      out.write("<div class=\"panel-heading\"><h3 class=\"panel-title\"><a href=\"add?method=doGet&post=post8&postCount=8\"><h3>Post 8: &nbsp</h3><h4>One way to implement deep copy is to add copy constructors to each associated class. A copy constructor takes an instance of this as its single argument and copies all the values from it. Quite some work but pretty straightforward and safe.  note that you don not need to use accessor methods to read fields. You can access all fields directly because the source instance is always of the same type as the instance with the copy constructor. Obvious but might be overlooked. Example Note that when using copy constructors you need to know the runtime type of the object you are copying. With the above approach you cannot easily copy a mixed list.</h4></a></h3></div>\r\n");
