      out.write("<div class=\"panel-heading\"><h3 class=\"panel-title\"><a href=\"add?method=doGet&post=post9&postCount=9\"><h3>Post 9: &nbsp</h3><h4>Inheritance is when a class derives from an existing class.So if you have a Person class  then you have a Student class that extends Person  Student inherits all the things that Person has.There are some details around the access modifiers you put on the fields methods in Person  but that's the basic idea.For example if you have a private field on Person  Student won't see it because its private and private fields are not visible to subclasses. Polymorphism deals with how the program decides which methods it should use depending on what type of thing it has. If you have a Person  which has a read method and you have a Student which extends Person  which has its own implementation of read  which method gets called is determined for you by the runtime  depending if you have a Person or a Student. Thats the polymorphism in action.You can do that assignment because a Student is a Person  but the runtime is smart enough to know that the actual type of p is Student.Note that details differ among languages.You can do inheritance in javascript for example  but its completely different than the way it works in Java.</h4></a></h3></div>\r\n");
